    const authFor= props.authFor
    const authFunction= props.authFunction
    const log= ()=>console.log('ciao')
    return (
        <Grid item xs={12} display="flex" justifyContent="center" alignItems="center">
            <Typography variant="h6" align="center"> Autorizzazione necessaria per accedere ai tuoi {authFor}, vuoi autorizzare ora?</Typography>
            <Button
                variant="contained"
                onClick={() => {
                    log()
